import './App.css';
import Albums from './Components/Albums';
import Cards from './Components/Cards';
import Nav from './Components/Nav';
import SideBar from './Components/SideBar';
import { Container }  from "./Components/Styled";

function App() {
  return (
    <div className="App">
      <Nav />
      <SideBar />
      <Container>
        <Cards />
        <Albums />
      </Container>
    </div>
  );
}

export default App;
